// Parse AI agent output and extract relevant fields
let aiOutput = $input.item.json.output;

// --- START: AI Output Cleaning ---
const jsonMatch = aiOutput.match(/\{[\s\S]*\}/);
if (jsonMatch) {
  aiOutput = jsonMatch[0];
} else {
  aiOutput = null; 
}
// --- END: AI Output Cleaning ---

let parsedData;
try {
  if (aiOutput === null) throw new Error("No valid JSON object found in AI output.");
  parsedData = JSON.parse(aiOutput);
} catch (e) {
  // Parsing failed, return data that won't cause a Notion API error
  return { 
    title: 'Error: Failed to parse AI output', 
    summary: $input.item.json.output, // Keep original output for debugging
    tags: [], 
    priority: 1, 
    url: null, 
    publishedDate: null 
  };
}

// === START: Notion Multi-Select Fix ===
const tagsArray = parsedData.tags || [];
// === END: Notion Multi-Select Fix ===

// === START: Robust Notion Date Fix ===
// Ensure the publishedDate is a valid ISO string or null.
let notionDate = null;
if (parsedData.publishedDate) {
  const dateObject = new Date(parsedData.publishedDate);

  // Create a Date object and check if it's a valid date.
  // isNaN(dateObject.getTime()) is a reliable way to check for "Invalid Date".
  if (dateObject instanceof Date && !isNaN(dateObject.getTime())) {
    notionDate = dateObject.toISOString();
  } else {
    // If the date string is invalid, notionDate remains null.
    console.log(`Could not parse date: ${parsedData.publishedDate}`);
  }
}
// === END: Robust Notion Date Fix ===


// Extract the fields and create the final result object
const result = {
  title: parsedData.title || '',
  summary: parsedData.summary || '',
  tags: tagsArray,
  priority: parsedData.priority || 1,
  url: parsedData.url || null,
  publishedDate: notionDate 
};

return result;

